import React from "react";

const Pokemon = ()=>{
    return(
        <>
            <div>
                <select>
                    <option value="1"> 1 </option>
                    <option value="25"> 1 </option>
                    <option value="3"> 1 </option>
                    <option value="4"> 1 </option>
                    <option value="5"> 1 </option>
                </select>
            </div>
        </>
    );
}

export default Pokemon;
